import { Layout, Space } from 'antd';
//导入Antd布局模块
const { Header, Footer, Sider, Content } = Layout;
//
const headerStyle = 
{
    textAlign: 'center',
    color: '#fff',
    height: 32,
    paddingInline: 50,
    lineHeight: '64px',
    backgroundColor: '#7dbcea',
};
const contentStyle = 
{
    textAlign: 'center',
    minHeight: 640,
    lineHeight: '120px',
    color: '#fff',
    backgroundColor: '#108ee9',
};
const siderStyle =
{
    textAlign: 'center',
    lineHeight: '120px',
    color: '#fff',
    backgroundColor: '#3ba0e9',
};
const footerStyle =
{
    textAlign: 'center',
    color: '#fff',
    backgroundColor: '#7dbcea',
};
function Lay()
{
    return(
        <Space
            direction="vertical"
            style={{
                width: '100%',
            }}
            size={[0, 48]}
        >
            <Layout>
                <Header style={headerStyle}>Header</Header>
                <Layout>
                    <Sider style={siderStyle}>Sider</Sider>
                    <Content style={contentStyle}>Content</Content>
                </Layout>
                <Footer style={footerStyle}>Footer</Footer>
            </Layout>
        </Space>
    
    );
}
export default Lay
